import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Paper, Typography } from "@material-ui/core";
import { MenuList, MenuItem } from "@material-ui/core";
import AddSharpIcon from "@material-ui/icons/AddSharp";
import FormatColorFillSharpIcon from "@material-ui/icons/FormatColorFillSharp";
import SlideShowSharpIcon from "@material-ui/icons/SlideshowSharp";

const useStyle = makeStyles(theme => ({
  paper: {
    width: "90%",
    padding: "1em",
    boxShadow: "none",
    background: "#fafafa",
    margin: "1em auto",
    display: "block"
  },
  sideBarMenu: {
    display: "inline-flex",
    flexGrow: 1,
    float: "right",
    margin: "0 1em"
  }
}));

export default function ComponentBar(props) {
  const classes = useStyle();
  return (
    <div>
      <Paper className={classes.paper}>
        <Typography>Appbar Basic</Typography>
        <MenuList className={classes.sideBarMenu}>
          <MenuItem>
            <SlideShowSharpIcon />
          </MenuItem>
          <MenuItem>
            <FormatColorFillSharpIcon />
          </MenuItem>
          <MenuItem>
            <AddSharpIcon />
          </MenuItem>
        </MenuList>
      </Paper>
    </div>
  );
}
